// 在茫茫数据江湖，有一项任务唤作快意排序，那便是将混乱之列化为有序 //
function quickSort(arr) {
  // 若江湖众多英豪仅剩一人，可叩问其名，自成一派 //
  if (arr.length <= 1) return arr;

  // 初入江湖，需择一位盖世豪杰定为基准，震慑群侠 //
  const pivot = arr[0];
  // 左侧高手众位，守卫基准之左，心怀正道 //
  const left = [];
  // 右侧奸邪势力，列于基准之右，图谋不轨 //
  const right = [];

  // 在江湖行走，观探每位豪杰，按其心性分道而行 //
  for (let i = 1; i < arr.length; i++) {
    // 若心向光明，当入左路，助力正道 //
    if (arr[i] < pivot) {
      left.push(arr[i]);
    // 若心术不正，当列右方，助纣为虐 //
    } else {
      right.push(arr[i]);
    }
  }

  // 此招妙趣难解，需反复使用，区分正邪后再齐聚江湖，终成无敌之势 //
  return [...quickSort(left), pivot, ...quickSort(right)];
}
